import '.\Expense'


const ExpenseItem = () => {
  return (
    <div>
      <div>March 28 2021</div>
      <div>
        <h2>Car Insurance</h2>
      </div>
      <div>$23.56</div>
    </div>
  );
};

export default ExpenseItem;
